      ar: يعرف هذا التصور أيضا باسم مخطط المربع والشارب ، ويقارن توزيعات مقياس ذي
        صلة عبر مجموعات متعددة. يؤكد المربع الموجود في المنتصف على متوسط ومتوسط وأرباع
        2 الداخلية. تصور الشعيرات حول كل صندوق الأرباع الدقيقة والقصوى والنطاق والخارجي
        2.
      de: Diese Visualisierung, die auch als Box-Whisker-Plot bezeichnet wird, vergleicht
        die Verteilungen einer Metrik über mehrere Gruppen hinweg. Der Kasten in der
        Mitte stellt den Mittelwert, den Median und die inneren 2 Quartile dar. Die
        sogenannten „Whisker“ um jede Box visualisieren die Min-, Max-, Range- und
        äußeren 2 Quartile.
      es: ''
      fr: Également connue sous le nom de diagramme en boîte à moustaches, cette visualisation
        compare les distributions d'une mesure connexe au sein de plusieurs groupes.
        La boîte du milieu met l'accent sur la moyenne, la médiane et les deux quartiles
        intérieurs. Les moustaches autour de chaque boîte visualisent le minimum,
        le maximum, l'étendue et les deux quartiles extérieurs.
      it: ''
      ja: 箱ひげ図とも呼ばれるこの視覚化は、複数のグループにわたる関連するメトリックの分布を比較します。中央のボックスは、平均、中央値、および内側の 2
        つの四分位を強調しています。各ボックスの周囲のひげは、最小値、最大値、範囲、および外側の 2 つの四分位数を視覚化します。
      ko: ''
      nl: Ook bekend als een doos en whisker plot, deze visualisatie vergelijkt de
        verdeling van een verwante metriek over meerdere groepen. De doos in het midden
        legt de middelste nadruk op de middelmatige, middelbare en binnenste kwartieren.
        De whiskers rond elke box visualiseer de min, max, bereik en de buitenste
        2 quartiles.
      pt: ''
      pt_BR: Também conhecida como gráfico de caixa e bigode, esta visualização compara
        as distribuições de uma métrica relacionada em vários grupos. A caixa no meio
        enfatiza a média, a mediana e os dois quartis internos. Os bigodes em torno
        de cada caixa visualizam o mínimo, o máximo, o intervalo e os dois quartis
        externos.
      ru: Эта диаграмма позволяет сравнить распределения значений некоторой меры внутри
        нескольких групп. Ящик в центре показывает среднее, медиану и два внутренних
        квартиля. Усы визуализируют минимум, максимум, диапазон и два внешних квартиля.
      sk: ''
      sl: Znan tudi kot grafikon škatla z brki. prikaže primerjavo porazdelitev povezanih
        mer v različnih skupinah. Škatla na sredini predstavlja povprečje, mediano
        in notranja 2 kvartila. Brki na vsaki škatli prikazujejo minimum, maksimum,
        območje in zunanja dva kvartila.
      sl_SI: Znan tudi kot grafikon škatla z brki. prikaže primerjavo porazdelitev
        povezanih mer v različnih skupinah. Škatla na sredini predstavlja povprečje,
        mediano in notranja 2 kvartila. Brki na vsaki škatli prikazujejo minimum,
        maksimum, območje in zunanja dva kvartila.
      tr: ''
      uk: Також відома як графік коробки та вусів, ця візуалізація порівнює розподіл
        спорідненої метрики для декількох груп. Коробка в середині підкреслює середні,
        медіани та внутрішні 2 кварталі. Вуси навколо кожної коробки візуалізують
        мінімальний, максимум, діапазон та зовнішні 2 квартали.
      zh: 也称为框须图，该可视化比较了一个相关指标在多个组中的分布。中间的框强调平均值、中值和内部2个四分位数。每个框周围的触须可视化了最小值、最大值、范围和外部2个四分区。
      zh_TW: 也稱為框須圖，該可視化比較了一個相關指標在多個組中的分布。中間的框强調平均值、中值和内部2個四分位數。每個框週围的触須可視化了最小值、最大值、範圍和外部2個四分區。
