    occurances:
    - superset-frontend/plugins/plugin-chart-echarts/src/Timeseries/Area/index.ts
    po_translations:
      ar: تتشابه المخططات المساحية مع المخططات الخطية من حيث أنها تمثل متغيرات بنفس
        المقياس ، لكن المخططات المساحية تكدس المقاييس فوق بعضها البعض.
      de: Flächendiagramme ähneln Liniendiagrammen, da sie Variablen mit der gleichen
        Skala darstellen, aber Flächendiagramme stapeln die Metriken übereinander.
      es: ''
      fr: Les graphiques en aires sont semblables aux diagrammes linéaires, car ils
        représentent des variables avec la même échelle, mais les graphiques en aires
        empilent les mesures les unes sur les autres.
      it: ''
      ja: 面グラフは、変数を同じスケールで表すという点で折れ線グラフに似ていますが、面グラフはメトリクスを互いに積み上げていきます。
