    po_translations:
      ar: بشكل افتراضي ، يتم تحميل كل مرشح على الأكثر 1000 خيار عند تحميل الصفحة الأولي.
        حدد هذا المربع إذا كان لديك أكثر من 1000 قيمة تصفية وتريد تمكين البحث الديناميكي
        الذي يقوم بتحميل قيم التصفية أثناء كتابة المستخدمين (قد يضيف ضغطا على قاعدة
        البيانات الخاصة بك).
      de: Standardmäßig lädt jeder Filter beim ersten Laden der Seite höchstens 1000
        Auswahlmöglichkeiten. Aktivieren Sie dieses Kontrollkästchen, wenn Sie über
        mehr als 1000 Filterwerte verfügen und die dynamische Suche aktivieren möchten,
        die Filterwerte während der Benutzereingabe lädt (was die Datenbank belasten
        kann).
      es: ''
      fr: Par défaut, chaque filtre charge au maximum 1000 choix lors du chargement
        initial de la page. Cochez cette case si vous avez plus de 1000 valeurs de
        filtre et que vous souhaitez activer la recherche dynamique qui charge les
        valeurs de filtre au fur et à mesure que les utilisateur·rice·s les saisissent
        (ce qui risque d'alourdir votre base de données).
      it: ''
      ja: デフォルトでは、各フィルターは最初のページ読み込み時に最大 1000 の選択肢を読み込みます。1000 を超えるフィルター値があり、ユーザーの入力時にフィルター値を読み込む動的検索を有効にしたい場合は、このボックスをオンにします
        (データベースに負荷がかかる可能性があります)。
      ko: ''
      nl: Standaard laadt elk filter maximaal 1000 keuzes bij de initiële lading.
        Vink dit selectievakje aan als u meer dan 1000 filterwaarden hebt en het dynamisch
        zoeken naar gebruikers als gebruikerstype wilt inschakelen (kan stress toevoegen
        aan uw database).
      pt: ''
      pt_BR: Por padrão, cada filtro carrega, no máximo, 1000 opções no carregamento
        inicial da página. Marque esta caixa se tiver mais de 1000 valores de filtro
        e pretenda ativar a pesquisa dinâmica que carrega os valores de filtro à medida
        que os usuários escrevem (pode aumentar o stress da sua base de dados).
      ru: По умолчанию, каждый фильтр загружает не больше 1000 элементов выбора при
        начальной загрузке страницы. Установите этот флаг, если у вас больше 1000
        значений фильтра и вы хотите включить динамический поиск, который загружает
        значения по мере их ввода пользователем (может увеличить нагрузку на вашу
        базу данных).
      sk: ''
      sl: Privzeto vsak filter pri nalaganju začetne strani naloži največ 1000 možnosti.
