      tr: ''
      uk: За замовчуванням кожен фільтр завантажує щонайменше 1000 варіантів при первинному
        завантаженні сторінки. Постановіть це поле, чи є у вас більше 1000 значень
        фільтра і хочете ввімкнути динамічний пошук, який завантажує значення фільтра,
