      es: ''
      fr: CVAS (create view as select) ne peut être exécuté qu'avec une requête comportant
        une seule instruction SELECT. Assurez-vous que votre requête ne comporte qu'une
        seule instruction SELECT. Essayez ensuite d'exécuter à nouveau votre requête.
      it: ''
      ja: CVAS (選択としてビューを作成) は、単一の SELECT ステートメントを含むクエリでのみ実行できます。クエリに SELECT ステートメントのみが含まれていることを確認してください。次に、クエリを再度実行してみます。
